import './App.css';
import Header from './components/header/Header';
import {
  BrowserRouter as Router,
  Route
} from "react-router-dom";
import Pages from './pages/Pages';


function App() {
  return (
    <>
<Header />
      <Router>

          <Route path="/" exact>
            <Pages />
          </Route>
      </Router>
    </>
  );
}

export default App;
